int count = 0;
Vector3 position1 = new Vector3(2789.8f, 4396.8f, 168.2f);
Vector3 position2 = new Vector3(2870.2f, 4369.5f, 174.5f);
Vector3 position3 = new Vector3(2826.9f, 4390.3f, 173.6f);

foreach (GameObject unit in GameObjects)
{
	if (unit.EntryID == 230671)
	{
		if (!unit.HasFlag(GameObjectFlags.InUse))
		{
			count++;
		}
	}
}

if (count > 0)
{
	Print("There are " + count + " Braziers left to summon Hyperious!");
	if (count == 3)
	{
		while(!MoveTo(position1))
		{
			yield return 100;
		}
	}
	else if (count == 2)
	{
		foreach (GameObject unit in GameObjects)
		{
			if (unit.EntryID == 230671 && !unit.HasFlag(GameObjectFlags.InUse))
			{
				if (unit.Distance2DTo(position2) < 10)
				{
					while(!MoveTo(position2))
					{
						yield return 100;
					}
					break;
				}
				else if (unit.Distance2DTo(position1) < 10)
				{
					while(!MoveTo(position1))
					{
						yield return 100;
					}
					break;
				}
			}
		}
	}
	else if (count == 1)
	{
		foreach (GameObject unit in GameObjects)
		{
			if (unit.EntryID == 230671 && !unit.HasFlag(GameObjectFlags.InUse))
			{
				if (unit.Distance2DTo(position3) < 10)
				{
					while(!MoveTo(position3))
					{
						yield return 100;
					}
					break;
				}
				else if (unit.Distance2DTo(position2) < 10)
				{
					while(!MoveTo(position2))
					{
						yield return 100;
					}
					break;
				}
				else
				{
					while(!MoveTo(position1))
					{
						yield return 100;
					}
					break;
				}
			}
		}
	}	
}
else
{
	DisableCombat = true;
	while(!MoveTo(position3))
	{
		yield return 100;
	}
	DisableCombat = false;
}

